class Line
  attr_accessor :title, :tel, :email, :adress, :website
  def initialize(title, tel, email, adress, website)
    @title = title
    @tel = tel
    @email = email
    @adress = adress
    @website = website
  end
end


def parsing_data(datas)

  total = []
  datas.each do |data|
    if data == data.upcase && data.scan(/\d/).empty?
      arr = Array.new
      arr << data
    else
      arr << data
    end
    unless total.include?(arr)
      total << arr
    end
  end
  p total

end


